import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { UserService } from '../services/user.service';
import Posao from '../models/posao';
import Odrzavanje from '../models/odrzavanje';

@Component({
  selector: 'app-zakazi-odrzavanje',
  templateUrl: './zakazi-odrzavanje.component.html',
  styleUrls: ['./zakazi-odrzavanje.component.css']
})
export class ZakaziOdrzavanjeComponent implements OnInit {
  constructor(private ruter:Router,private servis:UserService){}

  posao:Posao=new Posao()

  datum:string=''

  odrzavanje:Odrzavanje=new Odrzavanje()

  error:string=''


  ngOnInit(): void {


      const poslic=localStorage.getItem('brojOdPosla')
      if(poslic){
        this.posao=JSON.parse(poslic)
      }

  }


  potvrdi(){
    if(!this.datum){
      this.error='Niste uneli datum!'
      return
    }
    this.odrzavanje.vlasnik=this.posao.vlasnik
    this.odrzavanje.firma=this.posao.firma
    this.odrzavanje.idPosao=this.posao.id
    this.odrzavanje.datumPocetka=this.datum
    this.servis.saveOdrzavanje(this.odrzavanje).subscribe(
      poruka=>{
        if(poruka.msg=='ok'){
          alert('Uspesno cuvanje odrzavanja')
          this.ruter.navigate(['odrzavanje'])
        } else {
          alert('Doslo je do greske')
        }
      }
    )
  }


}
<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Početna Stranica</title>

</head>
<body>
    <header>
        <h1>Dobrodošli!</h1>
        <nav>
            <ul>
                <li><a href="/">Home</a></li>
                <li><a href="/vlasnik">Profil</a></li>
                <li><a href="/firme">Firme</a></li>
                <li><a href="/zakazivanja">Zakazivanja</a></li>
                <li><a href="/odrzavanje">Odrzavanja</a></li>
            </ul>
        </nav>
    </header>

    <main class="main-content"> <!-- Dodao main tag sa klasom -->
        <h2>Zakazite odrzavanje baste</h2> <!-- Naslov za sekciju -->
        <label for="datum">Datum dolaska majstora:</label>
        <input type="date" id="datum" [(ngModel)]="datum"> <br>
        <button class="action-button" (click)="potvrdi()">Potvrdi odrzavanje</button> <br>
        <div class="error-message" *ngIf="error">{{error}}</div> <!-- Dodao div za poruke o grešci -->
    </main>

    <footer>
        <p>&copy; 2024 Vaša bašta. Sva prava zadržana.</p>
    </footer>
</body>
</html>
